import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import "./Expenses.css";
import ExpensesFilter from "./ExpensesFilter";

function Expenses(props) {
  function saveExpenseFilterDataHandler(enteredExpenseFilterData) {
    const expenseFilerData = {
      ...enteredExpenseFilterData,
    };
    console.log(expenseFilerData);
    //props.onAddExpense(expenseData);
  }

  return (
    <div>
      <ExpensesFilter onSaveExpenseFilterData={saveExpenseFilterDataHandler} />
      <Card className="expenses">
        <ExpenseItem
          title={props.expense[0].title}
          amount={props.expense[0].amount}
          date={props.expense[0].date}
        />
        <ExpenseItem
          title={props.expense[1].title}
          amount={props.expense[1].amount}
          date={props.expense[1].date}
        />
        <ExpenseItem
          title={props.expense[2].title}
          amount={props.expense[2].amount}
          date={props.expense[2].date}
        />
      </Card>
    </div>
  );
}

export default Expenses;
